import React, { useState, useEffect, useRef } from 'react';
import { useNavigate } from 'react-router-dom';
import './FindPartnerInterface.css';

const FindPartnerInterface = ({ userData }) => {
  const navigate = useNavigate();
  const [selectedRoom, setSelectedRoom] = useState(null);
  const [messages, setMessages] = useState({});
  const [newMessage, setNewMessage] = useState('');
  const [selectedFiles, setSelectedFiles] = useState([]);
  const messagesEndRef = useRef(null);

  const chatRooms = [
    { id: 'basketball', name: 'ÁØÆÁêÉ', icon: 'üèÄ', description: 'ÁØÆÁêÉÁà±Â•ΩËÄÖËÅöÈõÜÂú∞' },
    { id: 'skateboard', name: 'ÊªëÊùø', icon: 'üõπ', description: 'ÊªëÊùøÊäÄÂ∑ß‰∫§ÊµÅ' },
    { id: 'music', name: 'Èü≥‰πê', icon: 'üéµ', description: 'Èü≥‰πêÂàÜ‰∫´‰∏éËÆ®ËÆ∫' },
    { id: 'study', name: 'Â≠¶‰π†', icon: 'üìö', description: 'Â≠¶‰π†‰∫§ÊµÅ‰∫íÂä©' },
    { id: 'gaming', name: 'Ê∏∏Êàè', icon: 'üéÆ', description: 'Ê∏∏ÊàèÊê≠Â≠êÂØªÊâæ' },
    { id: 'photography', name: 'ÊëÑÂΩ±', icon: 'üì∑', description: 'ÊëÑÂΩ±ÊäÄÂ∑ßÂàÜ‰∫´' }
  ];

  useEffect(() => {
    // ‰ªélocalStorageÂä†ËΩΩËÅäÂ§©ËÆ∞ÂΩï
    const savedMessages = localStorage.getItem('chatMessages');
    if (savedMessages) {
      setMessages(JSON.parse(savedMessages));
    }
  }, []);

  useEffect(() => {
    // ÊªöÂä®Âà∞ÊúÄÊñ∞Ê∂àÊÅØ
    messagesEndRef.current?.scrollIntoView({ behavior: 'smooth' });
  }, [messages, selectedRoom]);

  const saveMessages = (newMessages) => {
    setMessages(newMessages);
    localStorage.setItem('chatMessages', JSON.stringify(newMessages));
  };

  const sendMessage = () => {
    if ((!newMessage.trim() && selectedFiles.length === 0) || !selectedRoom) return;

    const message = {
      id: Date.now(),
      content: newMessage.trim(),
      files: selectedFiles.map(file => ({
        name: file.name,
        type: file.type,
        url: URL.createObjectURL(file)
      })),
      author: {
        nickname: userData.nickname,
        grade: userData.grade,
        class: userData.class,
        avatar: userData.avatar
      },
      timestamp: new Date().toISOString()
    };

    const updatedMessages = {
      ...messages,
      [selectedRoom]: [...(messages[selectedRoom] || []), message]
    };

    saveMessages(updatedMessages);
    setNewMessage('');
    setSelectedFiles([]);
  };

  const handleFileSelect = (e) => {
    const files = Array.from(e.target.files);
    setSelectedFiles(files);
  };

  const formatTimestamp = (timestamp) => {
    const date = new Date(timestamp);
    return date.toLocaleTimeString('zh-CN', { 
      hour: '2-digit', 
      minute: '2-digit' 
    });
  };

  const getRoomMessages = (roomId) => {
    return messages[roomId] || [];
  };

  const getLastMessage = (roomId) => {
    const roomMessages = getRoomMessages(roomId);
    if (roomMessages.length === 0) return 'ÊöÇÊó†Ê∂àÊÅØ';
    const lastMsg = roomMessages[roomMessages.length - 1];
    if (lastMsg.content) {
      return lastMsg.content.length > 20 ? 
        lastMsg.content.substring(0, 20) + '...' : 
        lastMsg.content;
    }
    if (lastMsg.files.length > 0) {
      return lastMsg.files[0].type.startsWith('image/') ? '[ÂõæÁâá]' : '[Êñá‰ª∂]';
    }
    return 'ÊöÇÊó†Ê∂àÊÅØ';
  };

  const getUnreadCount = (roomId) => {
    // ËøôÈáåÂèØ‰ª•ÂÆûÁé∞Êú™ËØªÊ∂àÊÅØËÆ°Êï∞ÈÄªËæë
    return Math.floor(Math.random() * 5); // Á§∫‰æãÔºöÈöèÊú∫Êú™ËØªÊï∞
  };

  const handleKeyPress = (e) => {
    if (e.key === 'Enter' && !e.shiftKey) {
      e.preventDefault();
      sendMessage();
    }
  };

  if (selectedRoom) {
    const room = chatRooms.find(r => r.id === selectedRoom);
    const roomMessages = getRoomMessages(selectedRoom);

    return (
      <div className="chat-room">
        {/* ËÅäÂ§©ÂÆ§Â§¥ÈÉ® */}
        <header className="chat-header">
          <button 
            className="back-btn" 
            onClick={() => setSelectedRoom(null)}
          >
            ‚Üê ËøîÂõû
          </button>
          <div className="room-info">
            <span className="room-icon">{room.icon}</span>
            <span className="room-name">{room.name}</span>
          </div>
          <div className="room-members">
            Âú®Á∫ø {Math.floor(Math.random() * 50) + 10}
          </div>
        </header>

        {/* Ê∂àÊÅØÂàóË°® */}
        <main className="messages-container">
          <div className="messages-list">
            {roomMessages.length > 0 ? (
              roomMessages.map(message => (
                <div key={message.id} className="message-item">
                  <div className="message-avatar">
                    {message.author.avatar ? (
                      <img src={message.author.avatar} alt="Â§¥ÂÉè" />
                    ) : (
                      message.author.nickname.charAt(0)
                    )}
                  </div>
                  <div className="message-content">
                    <div className="message-header">
                      <span className="message-author">
                        {message.author.nickname}
                      </span>
                      <span className="message-meta">
                        {message.author.grade} {message.author.class}
                      </span>
                      <span className="message-time">
                        {formatTimestamp(message.timestamp)}
                      </span>
                    </div>
                    {message.content && (
                      <div className="message-text">
                        {message.content}
                      </div>
                    )}
                    {message.files.length > 0 && (
                      <div className="message-files">
                        {message.files.map((file, index) => (
                          <div key={index} className="message-file">
                            {file.type.startsWith('image/') ? (
                              <img 
                                src={file.url} 
                                alt={file.name} 
                                className="message-image" 
                              />
                            ) : file.type.startsWith('video/') ? (
                              <video 
                                src={file.url} 
                                controls 
                                className="message-video" 
                              />
                            ) : (
                              <div className="file-placeholder">
                                üìé {file.name}
                              </div>
                            )}
                          </div>
                        ))}
                      </div>
                    )}
                  </div>
                </div>
              ))
            ) : (
              <div className="empty-messages">
                <div className="empty-icon">{room.icon}</div>
                <h3>Ê¨¢ËøéÊù•Âà∞{room.name}ËÅäÂ§©ÂÆ§ÔºÅ</h3>
                <p>ÂºÄÂßãËÅäÂ§©ÔºåËÆ§ËØÜÊñ∞ÊúãÂèãÂêßÔΩû</p>
              </div>
            )}
            <div ref={messagesEndRef} />
          </div>
        </main>

        {/* Ê∂àÊÅØËæìÂÖ•Âå∫ */}
        <footer className="message-input-area">
          {selectedFiles.length > 0 && (
            <div className="selected-files-preview">
              {selectedFiles.map((file, index) => (
                <div key={index} className="selected-file-item">
                  <span>{file.name}</span>
                  <button 
                    onClick={() => setSelectedFiles(files => 
                      files.filter((_, i) => i !== index)
                    )}
                  >
                    √ó
                  </button>
                </div>
              ))}
            </div>
          )}
          <div className="input-row">
            <label className="file-btn">
              üìé
              <input
                type="file"
                multiple
                accept="image/*,video/*"
                onChange={handleFileSelect}
                style={{ display: 'none' }}
              />
            </label>
            <textarea
              className="message-input"
              value={newMessage}
              onChange={(e) => setNewMessage(e.target.value)}
              onKeyPress={handleKeyPress}
              placeholder="ËæìÂÖ•Ê∂àÊÅØ... (Shift+EnterÊç¢Ë°å)"
              rows="1"
            />
            <button 
              className="send-btn"
              onClick={sendMessage}
              disabled={!newMessage.trim() && selectedFiles.length === 0}
            >
              ÂèëÈÄÅ
            </button>
          </div>
        </footer>
      </div>
    );
  }

  return (
    <div className="find-partner-interface">
      {/* Â§¥ÈÉ® */}
      <header className="partner-header">
        <button className="back-btn" onClick={() => navigate('/')}>
          ‚Üê ËøîÂõû
        </button>
        <h1>ÊâæÊê≠Â≠ê</h1>
        <div className="online-count">
          Âú®Á∫ø {Math.floor(Math.random() * 200) + 100}
        </div>
      </header>

      {/* ËÅäÂ§©ÂÆ§ÂàóË°® */}
      <main className="rooms-content">
        <div className="rooms-list">
          {chatRooms.map(room => {
            const unreadCount = getUnreadCount(room.id);
            return (
              <div 
                key={room.id} 
                className="room-item"
                onClick={() => setSelectedRoom(room.id)}
              >
                <div className="room-icon-large">
                  {room.icon}
                </div>
                <div className="room-details">
                  <div className="room-header">
                    <h3 className="room-name">{room.name}</h3>
                    {unreadCount > 0 && (
                      <span className="unread-badge">{unreadCount}</span>
                    )}
                  </div>
                  <p className="room-description">{room.description}</p>
                  <div className="room-last-message">
                    {getLastMessage(room.id)}
                  </div>
                </div>
                <div className="room-arrow">
                  ‚Üí
                </div>
              </div>
            );
          })}
        </div>

        <div className="tips-section">
          <h3>üí° ËÅäÂ§©Â∞èË¥¥Â£´</h3>
          <ul>
            <li>‰øùÊåÅÂèãÂñÑÔºåÂ∞äÈáç‰ªñ‰∫∫</li>
            <li>ÂàÜ‰∫´ÊúâË∂£ÁöÑËØùÈ¢òÂíåÁªèÈ™å</li>
            <li>ÊâæÂà∞ÂøóÂêåÈÅìÂêàÁöÑÊúãÂèã</li>
            <li>ÈÅµÂÆàËÅäÂ§©ÂÆ§ËßÑÂàô</li>
          </ul>
        </div>
      </main>
    </div>
  );
};

export default FindPartnerInterface;
